<html>
    <head><title>Fector</title></head>
    <body>
        <script>
           
           number=parseInt(prompt("Enter number"))
     for(i=1;i<number;i++){
    if (number % i == 0)
                {
                    document.write(i+" ")
                }
    
    
   }    
       
   
        </script>
    </body>
</html>
